import React from 'react'
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import Navbar from './Navbar';

function Home() {
    return (






        <BrowserRouter>
            <Navbar />
            <Routes>

                <Route path='/' element={<Home />}> </Route>
                <Route path='/reviewMe' element={<Reviewme />}> </Route>
                <Route path='/updatecontactinfo' element={<UpdateContactInfo />}> </Route>


            </Routes>
        </BrowserRouter>
    )
}

export default Home
